INSERT INTO projet VALUES (443,1048,1,1,1,1,1,1,0,1,2,'09','14','0610','Tecnocosmesi','Tecnocosmesi',1,NULL,'0610 (tecnocosmesi)',4,0,0,4,0,NULL,305,'Groupe Montoni','4115, Aut des Laurentides','Laval','Québec','Canada','H7L 5W5','(450) 978-7500','(450) 978-7501',1189,'Paul','Ghaleb','450-978-7500 #288','514-214-6262','pghaleb@groupemontoni.com',NULL,'S1084',1084,'soumission signée',5,193,2,89,0,212,1,'','MERCI DE RÉPONDRE RAPIDEMENT, MÊME SI NÉGATIF.  \r\n\r\n\r\nBonjour,\r\n\r\nNous vous invitons à soumissionner le projet de construction de la nouvelle bâtisse CERTIFIÉE LEED à Laval ( Ce projet nous appartient ).  Aucun BSDQ ne sera considéré.  La structure, mécanique et l’électricité sont en conception/réalisation.\r\n\r\nÀ noter :\r\n\r\n1)	Étendue des travaux:           Nouveau bâtiment de 98 187 pi.ca. incluant 64 200 pi.ca. de de production et 8046 pi.ca. bureaux au RDC et 25 941 pi.ca. de bureau et production sur mezzanine.\r\n\r\n2)	Les plans et devis sont accessibles sur notre site FTP au:\r\n\r\nhttps://sfiles.groupemontoni.com/\r\n\r\nNom d’utilisateur :         Projet_Marc\r\nMOT DE PASSE :              BK3VB8mm\r\n\r\n3)	Date de Fermeture : Jeudi 20 mars 2014 @ 10:00   IMPORTANT’ SVP RESPECTER CETTE DATE CAR LA SIGNATURE DU CONTRAT EST PRÉVUE POUR LA SEMAINE DU 24 MARS\r\n\r\n4)	Particularités :\r\n\r\n4.1 – Veuillez soumettre en prix séparé les coûts relatif au fait que le projet soit certifié LEED\r\n4.2 – Veuillez soumettre un prix séparé exclus pour tout ce qui a trait à la production ( voir plans annotés en couleur )\r\n4.3 – Pour les coûts de production séparés, veuillez inclure :\r\n               4.3.1 – Murs en panneaux pré-fabriqués\r\n               4.3.2 – Plafonds en panneaux pré-fabriqués\r\n               4.3.3 – Portes et fenêtres tel qu’utilisé dans l’alimentaire\r\n               4.3.4 – Recouvrement des éléments structuraux avec une tôle d’acier pré-peinte\r\n               4.3.5 – Appareils d’éclairage scellés, pour 50 pieds bougie\r\n               4.3.6 – Prises électriques ( 2 par pièces )\r\n               4.3.7 – Monte charge, incluant les murs, la mécanique et l’électricité\r\n               4.3.8 – Tout équipements mécaniques et raccordement de ces équipements est hors contrat pour le moment de même que tout raccordement d’équipements de production \r\n4.4 – Le chauffage de l’entrepôt sera par des aérothermes tandis que le chauffage des secteurs production ( RDC et étage ) sera avec de l’infra-rouge ( en considérant qu’il n’y a pas de divisions pour la production ), inclus dans le prix de base.  Soumettre un prix séparé inclus pour l’infra-rouge\r\n4.5 – Toutes les marquises au dessus des portes d’issues seront tel que celle situé au dessus des portes de garage entre les axes 13 à 15 ( structure d’acier légère et revêtement de corrugué ).\r\n4.6 – Prévoir que les panneaux métalliques préfabriqués seront recouverts de panneaux de béton léger et d’acrylique jusqu’à une hauteur de 14’\r\n4.7 – L’escalier en colimaçon sera de ‘’type Montoni’’.  Les autres escaliers seront standards avec barrottins et pannes, à remplir de béton et recouvrir de céramique.\r\n4.8 – Le revêtement de bois extérieur sera remplacé par un revêtement d’acier pré-peint ( Style déclin )\r\n4.9 – Veuillez prévoir qu’il y aura une porte de garage 14’ x 14’, motorisée, sur l’axe 13, entre B.5 et C\r\n4.10 – Le dessus de l’élément décoratif en façade sera à l’élévation 12 000, soit, 2m. au dessus de la toiture\r\n4.11 – Les solins en contact avec le mur rideau seront en aluminium, par le sous-traitant en fenestration.         \r\n\r\n5)	Pour être considérée conforme, toute soumission doit satisfaire aux conditions générales telles qu’énoncées dans la section « Annexe Sous-traitants »\r\n\r\n6)	Toute soumission reçue doit également énumérer clairement tous les documents reçus et utilisés pour soumissionner, avec la date des documents.\r\n\r\n7)	Toute demande d’information devra nous être acheminée à estimation@groupemontoni.com\r\n\r\n\r\nVeuillez confirmer si vous désirez soumissionner en nous retournant votre réponse aujourd’hui.\r\n	\r\nOUI, Nous soumissionnons	\r\n	\r\nNON, Nous ne soumissionnons pas	\r\n\r\nMerci de votre collaboration.\r\n\r\n\r\n\r\n\r\n\r\n \r\n	Marc Penelle, ing.\r\nChef estimateur\r\nT 450.978.7500 • 267\r\nF 450.978.7501\r\nC 514.821.2242\r\nmpenelle@groupemontoni.com\r\n\r\n		Groupe Montoni (1995)\r\nDivision Construction inc.\r\n4115, Autoroute Des Laurentides,\r\nLaval, QC, H7L 5W5\r\nwww.groupemontoni.com\r\n\r\n\r\n\r\n \r\nAvant d’imprimer ce courriel, merci de penser à l’environnement!\r\nThank you for thinking of the environment before printing this email!\r\n\r\nAvis de confidentialité\r\nCe message, son contenu et ses pièces jointes sont confidentiels et exclusivement adressés à son destinataire principal et aux autres destinataires indiqués. Si vous avez reçu ce message alors que vous n’êtes pas un destinataire désigné, veuillez en aviser immédiatement l’émetteur et détruire ce message et les pièces jointes.\r\nConfidentiality notice\r\nThis message and any attachments are intended only for the use of the intended recipient(s), are confidential, and may be privileged. If you are not intended recipient, you are hereby notified that any review, retransmission, conversion to hard copy, copying, circulation or other use of this message and any attachments is strictly prohibited. If you are not the intended recipient, please  notify the sender immediately by return e-mail, and delete this message and any attachments from your system.\r\n\r\n\r\n',NULL,'0610',NULL,NULL,NULL,NULL,'2014-07-01 16:40:17',1,'4372 desserte sud autoraute 440','curé label','Laval','Québec','Canada','H7T 2P7',NULL,NULL,NULL,NULL,'A coter de Montréal Néon',NULL,'2014-07-02',0,0,'100','100','100','100',38,1,'2014-11-04 11:08:22',67,0,NULL,0,'2014-10-29 14:57:37',75,0,0,0,0,0,NULL,0,0,0,0,0,0,0,0,NULL,NULL,0,0,0,NULL,0,0,0,0,NULL,NULL,0,0,0,'2014',1,'2015-01-23 10:09:05',5,'',NUL